    # Test Addition and Subtraction
    addi x1, x0, 5      # x1 = 5
    addi x2, x0, 3      # x2 = 3
    add x3, x1, x2      # x3 = x1 + x2 = 8
    sub x4, x3, x2      # x4 = x3 - x2 = 5
    # Test Logical Operations
    xor x5, x1, x2      # x5 = x1 ^ x2 (5 ^ 3 = 6)
    or x6, x1, x2       # x6 = x1 | x2 (5 | 3 = 7)
    and x7, x1, x2      # x7 = x1 & x2 (5 & 3 = 1)
    # Test Shift Operations
    sll x8, x1, x2      # x8 = x1 << x2 (5 << 3 = 40)
    srl x9, x8, x2      # x9 = x8 >> x2 (40 >> 3 = 5)
    sra x10, x8, x2     # x10 = x8 >>> x2 (arithmetic right shift)
    # Test Immediate Instructions
    addi x11, x0, -4    # x11 = -4
    andi x12, x11, 7    # x12 = -4 & 7 (binary: 11111100 & 00000111 = 4)
    ori x13, x11, 2     # x13 = -4 | 2 (-4 in binary OR 2)
    xori x14, x11, 2    # x14 = -4 ^ 2 (-4 in binary XOR 2)
