    addi x6, x4, 0x412 # Min negative 32-bit integer
    add x7, x5, x6          # x7 = 0x7FFFFFFF + 0x80000000 (overflow edge case)
    sub x8, x5, x6          # x8 = 0x7FFFFFFF - (-0x80000000) (should be huge)
