    sra x14, x5, x6        # Arithmetic right shift max pos by min neg
    sll x15, x6, x5        # Left shift min neg by max pos
    srl x16, x6, x5        # Logical right shift min neg by max pos
    sra x17, x6, x5        # Arithmetic right shift min neg by max pos
