    sltu x19, x6, x5       # -0x80000000 < 0x7FFFFFFF unsigned? Should be 0
    slt x20, x5, x6        # 0x7FFFFFFF < -0x80000000? Should be 0
    sltu x21, x5, x6       # 0x7FFFFFFF < -0x80000000 unsigned? Should be 1
